import React from "react";
import { Link } from "react-router-dom";

export default function TeamComp({ teams }) {
  return (
    <>
      <h3>Teams</h3>
      <div className="team-list">
        <div className="division-wrapper">
          {teams.map((team, i) => {
            if (team.division === "Central") {
              return (
                <Link key={i} to={`/teams/${team.abbreviation}`}>
                  <p>{team.full_name}</p>
                </Link>
              );
            }
          })}
        </div>

        <div>
          {teams.map((team, i) => {
            if (team.division === "Atlantic") {
              return (
                <Link key={i} to={`/teams/${team.abbreviation}`}>
                  <p>{team.full_name}</p>
                </Link>
              );
            }
          })}
        </div>

        <div>
          {teams.map((team, i) => {
            if (team.division === "Southeast") {
              return (
                <Link key={i} to={`/teams/${team.abbreviation}`}>
                  <p>{team.full_name}</p>
                </Link>
              );
            }
          })}
        </div>

        <div>
          {teams.map((team, i) => {
            if (team.division === "Southwest") {
              return (
                <Link key={i} to={`/teams/${team.abbreviation}`}>
                  <p>{team.full_name}</p>
                </Link>
              );
            }
          })}
        </div>

        <div>
          {teams.map((team, i) => {
            if (team.division === "Pacific") {
              return (
                <Link key={i} to={`/teams/${team.abbreviation}`}>
                  <p>{team.full_name}</p>
                </Link>
              );
            }
          })}
        </div>

        <div>
          {teams.map((team, i) => {
            if (team.division === "Northwest") {
              return (
                <Link key={i} to={`/teams/${team.abbreviation}`}>
                  <p>{team.full_name}</p>
                </Link>
              );
            }
          })}
        </div>
      </div>
    </>
  );
}
